import React from 'react';
import { View,Text,TextInput,Alert,StatusBar,TouchableOpacity,StyleSheet } from 'react-native';
import  Login from '../Components/Login';
import  User from '../Models/User';

const SignUpScreen = (props) => {

  const [NewUser , SetNewUser] = React.useState(new User('','','','','',''));
  const [profilePic, SetProfilePic] = React.useState(null);
  


  const  handleNewUser = ( name, value ) => {

    // console.log(name+": "+value);
    SetNewUser(prevState => ({
        ...prevState,
        [name]: value
    }));
};

  const SignUpUser = () => {
    console.log(Object.keys(NewUser).length  );
   
    
  };
  return (
    <Login Title="SignUp" loginUser={SignUpUser} ProfilePic={profilePic}   navigation={props.navigation}>
    <TextInput
       placeholder="First Name"
       placeholderTextColor="#808e9b"
       style={styles.input}
       autoCorrect={true}
       // autoCapitalize={false}
       autoCompleteType="name"
       keyboardType="default"
       textContentType="name"
       bind={NewUser.firstName}
       onChangeText={(e)=> handleNewUser('firstName',e)}
     />
      <TextInput
       placeholder="Last Name"
       placeholderTextColor="#808e9b"
       style={styles.input}
       autoCorrect={true}
       // autoCapitalize={false}
       autoCompleteType="name"
       keyboardType="default"
       textContentType="name"
       bind={NewUser.lastName}
       onChangeText={(e)=> handleNewUser('lastName',e)}
     />
      <TextInput
       placeholder="Username"
       placeholderTextColor="#808e9b"
       style={styles.input}
       autoCorrect={true}
       // autoCapitalize={false}
       autoCompleteType="name"
       keyboardType="default"
       textContentType="name"
       bind={NewUser.username}
       onChangeText={(e)=> handleNewUser('username',e,)}
     />
     <TextInput
       placeholder="Password"
       placeholderTextColor="#808e9b"
       style={styles.input}
       secureTextEntry={true}
       textContentType="password"
       bind={NewUser.password}
       onChangeText={(e)=> handleNewUser('password',e,)}
     />
 </Login>
  );
}


const styles = StyleSheet.create({
  
  input: {
    width: '100%',
    height: 50,
    backgroundColor: '#333',
    borderRadius: 6,
    marginTop: 10,
    paddingHorizontal: 10,
    fontSize: 16,
    color: '#808e9b',
  },
   
});

export default SignUpScreen;
